import { useEffect, useState } from 'react';

function Targets() {

  const [targets, setType] = useState([]);
  useEffect(()=>{
    fetch('http://localhost:3000/target')
      .then(response => response.json())
      .then(setType);
  }, []);

  return (
      <datalist id="targetlist">
        { targets.map(item =>
          <option key={ item.id } value={item.name} id="targets" name="targets" >{item.name}</option>
        )}
      </datalist>
  );
}

export default Targets;
